INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES
(1, 1, '2016-05-18 16:43:59', 'Community Edition 2.0.6 Provides Important Security and Functional Updates – 5/18/2016', 'Magento Community Edition 2.0.6 is now available and contains important security and functional improvements. More information on the security updates can be found on the Magento Security Center at https://magento.com/security/patches/magento-206-security-update. More information on the functional enhancements is provided in the release notes: http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.6CE.html', 'https://magento.com/security/patches/magento-206-security-update', 1, 1),
(2, 4, '2016-05-22 18:41:58', 'Repo.magento.com is currently unavailable. We are working to resolve this issue as quickly as possible – 5/22/16, 11:40 am PT', 'Users currently cannot access Magento 2 code updates from Repo.magento.com. We are investigating the issue and will update you when it is resolved. As an alternative, you can still access Magento 2 code from GitHub (https://github.com/magento/magento2) or from the Community Edition download page (https://www.magentocommerce.com/download). ', 'https://github.com/magento/magento2', 1, 1),
(3, 4, '2016-05-22 23:12:08', 'Issue with repo.magento.com has been resolved - 5/22/16, 4 pm PT', 'The issue with repo.magento.com has been resolved. You should be able to access Magento 2 code updates at this time.', 'http://devdocs.magento.com/guides/v2.0/install-gde/prereq/integrator_install.html', 1, 1),
(4, 4, '2016-05-24 14:08:30', 'New release: Magento Community Edition 2.0.7 Resolves Payment Gateway Issues – 5/24/16 ', 'Magento Community Edition 2.0.7 is now available. It resolves payment gateway issues experienced when using PHP 7.0.3. Review the release notes for more information: http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.7CE.html.', 'http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.7CE.html', 0, 1);
