INSERT INTO `cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(1, 'Flvour Sec', 'flvour-sec', '<div class="flvour-sec">\r\n<div class="container">\r\n<div class="col-md-7 col-md-offset-5">\r\n<div class="flvour-text">\r\n<h2>Hugo comes in just one flavour: perfect medium.</h2>\r\n<p>He''s not too hard, not too soft.<br /> Goldilocks would totally sleep on him.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '2016-05-13 07:00:12', '2016-05-20 06:53:31', 1),
(2, 'Deliver Sec', 'deliver-sec', '<div class="deliver-sec">\r\n<div class="container">\r\n<h2>We deliver Hugo for free,</h2>\r\n<p>in a box that actually fits through human doorways.</p>\r\n</div>\r\n</div>', '2016-05-13 07:01:07', '2016-05-19 10:09:20', 1),
(3, 'Rest Assured Sec', 'rest-assured-sec', '<div class="rest-assured-sec">\r\n<div class="container">\r\n<div class="assured-details">\r\n<div class="icons"><img src="{{view url="images/calender-icon.png"}}" alt="" /></div>\r\n<h2>Rest assured</h2>\r\n<p>You''ve got 3 whole months to change your mind.<br /> If you don''t like Hugo, send him back for a full refund.</p>\r\n<p class="italic">He won''t take it personally.</p>\r\n</div>\r\n</div>\r\n</div>', '2016-05-13 07:02:00', '2016-05-21 13:54:18', 1),
(4, 'Footer Links', 'footer-links', '<ul>\r\n<li><a href="{{store url=""}}">Home</a></li>\r\n<li><a href="{{store url="mattress"}}">Mattress</a></li>\r\n<li><a href="{{store url="about"}}">About</a></li>\r\n<li><a href="{{store url="support"}}">Support</a></li>\r\n<li><a href="{{store url="because-size-matters.html"}}">Shop</a></li>\r\n</ul>\r\n<script type="text/javascript">// <![CDATA[\r\njQuery(document).ready(function($){  \r\n    var url = window.location.href;\r\n    jQuery(''.footer-links ul li a[href="''+url+''"]'').addClass(''active'');	\r\n});\r\njQuery(window).load(function(){\r\n\r\njQuery(''.swatch-attribute-options div[option-id="24"]'').click();\r\njQuery(''.swatch-attribute-options div[option-id="28"]'').click();\r\n\r\njQuery(''.swatch-attribute-options div[option-id="24"]'').click(function() {\r\n\r\njQuery(''.swatch-attribute-options div[option-id="28"]'').click();\r\n});\r\njQuery(''.swatch-attribute-options div[option-id="25"]'').click(function() {\r\n  jQuery(''.swatch-attribute-options div[option-id="29"]'').click();\r\n});\r\njQuery(''.swatch-attribute-options div[option-id="26"]'').click(function() {\r\n  jQuery(''.swatch-attribute-options div[option-id="30"]'').click();\r\n});\r\njQuery(''.swatch-attribute-options div[option-id="27"]'').click(function() {\r\n  jQuery(''.swatch-attribute-options div[option-id="31"]'').click();\r\n});\r\n});\r\n// ]]></script>', '2016-05-13 07:02:49', '2016-05-21 13:08:24', 1),
(5, 'Countsheet Sec', 'countsheet-sec', '<div class="countsheet-sec">\r\n<div class="container">\r\n<h2>Count sheep,<br /> not mattresses.</h2>\r\n<p>You know those mattress shops with a billion models<br>and patented Sweet Dream&reg; technology? Yeah,<br>Hugo isn’t like that. Just one incredible mattress.</p>\r\n<a class="see-btn" href="{{store url="mattress"}}">See the mattress</a></div>\r\n</div>', '2016-05-13 07:03:38', '2016-05-20 06:56:28', 1),
(6, 'Footer Contact', 'footer-contact', '<h4><a href="{{store url="support"}}">Contact Hugo</a></h4>\r\n<ul class="social">\r\n<li><a href="https://www.facebook.com/hellohugosleep"><img src="{{view url="images/fb.png"}}" alt="" /></a></li>\r\n<li><a href="https://www.instagram.com/hugo_sleep/"><img src="{{view url="images/instagram.png"}}" alt="" /></a></li>\r\n<li><a href="https://play.spotify.com/user/hugo_sleep/playlist/7uW3faf09YhudO5mW5WGI7"><img src="{{view url="images/rss.png"}}" alt="" /></a></li>\r\n</ul>\r\n<div class="contact-info"><a href="mailto:hello@hugosleep.com.au">hello@hugosleep.com.au</a>\r\n<h3>AUS 1300 951 185</h3>\r\n</div>', '2016-05-13 07:04:25', '2016-05-21 15:08:37', 1),
(7, 'Top Menu', 'top-menu', '<div class="desktop-menu">\r\n<ul>\r\n<li><a href="{{store url="mattress"}}">Mattress</a></li>\r\n<li><a href="{{store url="about"}}">About</a></li>\r\n<li><a href="{{store url="support"}}">Support</a></li>\r\n<li><a href="{{store url="because-size-matters.html"}}">Shop</a></li>\r\n</ul>\r\n</div>\r\n<script type="text/javascript">// <![CDATA[\r\njQuery(document).ready(function($){\r\n    var url = window.location.href;\r\n    jQuery(''.menu-main-sec ul li a[href="''+url+''"]'').addClass(''active'');	\r\n});\r\n// ]]></script>', '2016-05-13 07:37:36', '2016-05-16 10:20:51', 1),
(8, 'Home Main Banner', 'home-main-banner', '<div class="container">\r\n<div class="banner-text-sec">\r\n<h2>Hi, this is Hugo.</h2>\r\n<p>Your knight in shining mattress.</p>\r\n<a class="see-btn" href="{{store url="mattress"}}">See the mattress</a></div>\r\n</div>\r\n<div class="scroll-arrow"><a href="#"><img src="{{view url="images/scroll-arrow.png"}}" alt="" /></a></div>', '2016-05-13 08:37:40', '2016-05-20 03:53:08', 1),
(9, 'Stickey Logo', 'stickey-logo', '<div class="logo col-md-4 col-sm-3 col-xs-12 stikey-logo"><a title="Magento Commerce" href="http://115.108.22.115:8081/projects/mg_magento2/code1/"> <img src="{{media url="wysiwyg/logo-blk.png"}}" alt="Magento Commerce" width="93" height="40" /> </a></div>', '2016-05-14 07:35:31', '2016-05-16 07:18:25', 1),
(10, 'About sleep easy sec', 'about-sleep-easy-sec', '<div class="sleep-easy-sec">\r\n<div class="container">\r\n<h3>Sleep easy with a</h3>\r\n<h2>3 month trial &amp; <br />10 year warranty.</h2>\r\n<a class="see-btn" href="{{store url="because-size-matters.html"}}">Shop Hugo</a></div>\r\n</div>', '2016-05-14 10:51:18', '2016-05-20 07:28:31', 1),
(11, 'About enter hugo sec', 'about-enter-hugo-sec', '<div class="enter-hugo-sec">\r\n<div class="container">\r\n<div class="enter-block">\r\n<h2>Enter Hugo.</h2>\r\n<p>We worked with sleep experts to design something easy and affordable, something made in Australia. Something that will help you actually sleep better.</p>\r\n<p class="italic">Isn&rsquo;t that what a mattress is for?</p>\r\n<div class="enter-image"><img src="{{media url="wysiwyg/illustration_4.png"}}" alt="" /></div>\r\n</div>\r\n</div>\r\n</div>', '2016-05-14 11:06:26', '2016-05-20 10:44:48', 1),
(12, 'About hugo like sec', 'about-hugo-like-sec', '<div class="hugo-like-sec">\r\n<div class="container">\r\n<h2>Hugo isn''t like the other guys.</h2>\r\n<div class="like-row clearfix odd">\r\n<div class="like-image mobile-show"><img src="{{media url="wysiwyg/illustration_1.png"}}" alt="" /></div>\r\n<div class="like-text">\r\n<h3>We won''t overwhelm<br /> you with choice.</h3>\r\n<p>Because whose bedroom ever resembled<br /> a busy department store? Try him out in<br /> your own space.</p>\r\n</div>\r\n<div class="like-image mobile-hide"><img src="{{media url="wysiwyg/illustration_1.png"}}" alt="" /></div>\r\n</div>\r\n<div class="like-row clearfix even">\r\n<div class="like-image"><img src="{{media url="wysiwyg/illustration_2.png"}}" alt="" /></div>\r\n<div class="like-text">\r\n<h3>He''ll never rip you off</h3>\r\n<p>We''ve simplifid the process<br /> to save you the dollars.</p>\r\n</div>\r\n</div>\r\n<div class="clearfix like-row odd">\r\n<div class="like-image mobile-show"><img src="{{media url="wysiwyg/illustration_3.png"}}" alt="" /></div>\r\n<div class="like-text">\r\n<h3>Hugo won''t pressure you into<br /> a committed relationship.</h3>\r\n<p>We don''t employ a ''no-take-baksies'' policy here. If it''s not meant to be, that''s cool.</p>\r\n</div>\r\n<div class="like-image mobile-hide"><img src="{{media url="wysiwyg/illustration_3.png"}}" alt="" /></div>\r\n</div>\r\n</div>\r\n</div>', '2016-05-14 11:08:07', '2016-05-20 10:41:18', 1),
(13, 'About-main-banner', 'about-main-banner', '<div class="container">\r\n<div class="banner-text-sec">\r\n<h2>Meet Hugo.</h2>\r\n<p>For too long the mattress mafia hasn''t changed.<br /> We''ve created Hugo so you don''t lose sleep<br />trying to fing your perfect mattress.</p>\r\n</div>\r\n</div>\r\n<div class="scroll-arrow"><a href="#"><img src="{{view url="images/scroll-arrow.png"}}" alt="" /></a></div>', '2016-05-14 11:12:49', '2016-05-20 07:42:35', 1),
(14, 'Mattriss free delivery sec', 'mattriss-free-delivery-sec', '<div class="free-delivery-sec">\r\n<div class="container">\r\n<h2>Free delivery, Australia wide.</h2>\r\n<p>You know what''s fun about carrying a mattress home yourself?<br /> Nothing. Nothing about that is fun. We''ll deliver Hugo straight to<br /> your door, vacuum-packed, boxed and ready to go.</p>\r\n<a class="see-btn" href="#">Shop Hugo</a></div>\r\n</div>', '2016-05-14 12:18:32', '2016-05-17 07:11:06', 1),
(15, 'Mattress mat slide sec', 'mattress-mat-slide-sec', '<div class="mat-slide-sec">\r\n<div class="container">\r\n<div class="slider-block">\r\n<ul class="met-slider">\r\n<li>\r\n<div class="slide-inner">\r\n<div class="image"><img src="{{view url="images/slider-img.png"}}" alt="" /></div>\r\n<h2>Fabric cover</h2>\r\n<p>We’ve dressed Hugo in a breathable, high-quality fabric that looks the business. It’s okay if you find yourself drawn to him. That’s normal. </p>\r\n</div>\r\n</li>\r\n<li>\r\n<div class="slide-inner">\r\n<div class="image"><img src="{{media url="wysiwyg/fabric_circle_2.png"}}" alt="" /></div>\r\n<h2>Gel Latex</h2>\r\n<p>Hugo''s latex allows air flow and gives you good support, and we''ve infused it with gel so you''ll sleep cool as a cucumber. Nice one, science.</p>\r\n</div>\r\n</li>\r\n<li>\r\n<div class="slide-inner">\r\n<div class="image"><img src="{{media url="wysiwyg/fabric_circle_3.png"}}" alt="" /></div>\r\n<h2>Gel Memory Foam</h2>\r\n<p>Memory foam matches your body''s natural contours. NASA worked on it for years, which is probably why the whole living-on-Mars thing is still a way off.</p>\r\n</div>\r\n</li>\r\n<li>\r\n<div class="slide-inner">\r\n<div class="image"><img src="{{media url="wysiwyg/fabric_circle_4.png"}}" alt="" /></div>\r\n<h2>High Density Support Foam</h2>\r\n<p>Hugo''s rock-solid foamy core. It''s thick and durable, will last for ages, and makes an excellent foundation for blanket forts. More supportive than a good therapist.</p>\r\n</div>\r\n</li>\r\n</ul>\r\n<script type="text/javascript">// <![CDATA[\r\n							jQuery(document).ready(function(){\r\n							  jQuery(''.met-slider'').bxSlider({\r\n								  pager: true,\r\n								  controls: false,  \r\n								});\r\n							});\r\n// ]]></script>\r\n</div>\r\n</div>\r\n</div>', '2016-05-14 12:20:14', '2016-05-20 09:42:23', 1),
(16, 'Mattress guts hugo sec', 'mattress-guts-hugo-sec', '<div class="guts-hugo-sec">\r\n            	<div class="container">\r\n                	<div class="guto-block">\r\n                    	<div class="guto-image">\r\n                        	<img src="{{view url="images/guts-hugo.png"}}" alt="" />\r\n                        </div>\r\n                        <div class="guto-text">\r\n                        	<h2>The guts of Hugo</h2>\r\n                            <p>A. 2.5cm gel memory foam</p>\r\n                            <p>B.  5cm gel infused natural latex</p>\r\n                            <p>C. 2.5cm gel memory foam</p>\r\n                            <p>D.  14.5cm high density support foam</p>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>', '2016-05-14 12:21:28', '2016-05-14 12:30:55', 1),
(17, 'Mattress bounce cool sec', 'mattress-bounce-cool-sec', '<div class="bounce-cool-sec">\r\n<div class="container">\r\n<div class="row clearfix">\r\n<div class="col-md-6 col-sm-6">\r\n<div class="bc-block">\r\n<div class="image"><img src="{{view url="images/Bounce.png"}}" alt="" /></div>\r\n<h2>Bounce where it counts</h2>\r\n<p>Hugo is designed so that when your partner zigs, you don&rsquo;t zag. Solid and stable, with just enough bounce to keep pillow fights interesting.</p>\r\n</div>\r\n</div>\r\n<div class="col-md-6 col-sm-6">\r\n<div class="bc-block">\r\n<div class="image"><img src="{{view url="images/cool.png"}}" alt="" /></div>\r\n<h2>Cool &amp; breezy</h2>\r\n<p>We’ve built Hugo from Gel Latex and Gel Memory Foam, which gets the air flowing, disperses heat and helps you stay cool at night. Yeah, science.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '2016-05-14 12:22:41', '2016-05-20 09:40:19', 1),
(18, 'Mattress just medium sec', 'mattress-just-medium-sec', '<div class="just-medium-sec">\r\n<div class="container">\r\n<h2>Wait, just medium?</h2>\r\n<p>Yep. Just medium. Perfect medium, really. Soft<br />  enough for a lazy Sunday Netflix binge, but firm<br />  enough to keep your chiropractor out of business. </p>\r\n</div>\r\n</div>', '2016-05-14 12:23:50', '2016-05-20 09:35:39', 1),
(19, 'Mattress prices fair sec', 'mattress-prices-fair-sec', '<div class="prices-fair-sec">\r\n<div class="container">\r\n<h2>Less fingers in the pie to keep prices fair.</h2>\r\n<div class="fair-process mobile-hide"><img src="{{media url="wysiwyg/fair-process-desk.png"}}" alt="" /></div>\r\n<div class="fair-process mobile-show"><img src="{{media url="wysiwyg/fair-process-mobile.png"}}" alt="" /></div>\r\n</div>\r\n</div>', '2016-05-14 12:25:15', '2016-05-20 09:37:02', 1),
(20, 'Mattress main banner', 'mattress-main-banner', '<div class="container">\r\n                	<div class="banner-text-sec">\r\n                      	<h2>Made in Australia, mate.</h2>\r\n                    </div>\r\n                </div>\r\n <div class="scroll-arrow">\r\n            	<a href="#"><img src="{{view url="images/scroll-arrow.png"}}" alt="" /></a>\r\n            </div>', '2016-05-14 12:26:47', '2016-05-14 12:32:20', 1),
(21, 'Mattress mat details sec', 'mattress-mat-details-sec', '<div class="mat-details-sec">\r\n<div class="container">\r\n<table class="show-table" style="display: none;" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td class="title">MEASUREMENTS<br /> &amp; DIMENSIONS<br /> (Size Guide)</td>\r\n<td class="details">\r\n<div class="masurments">\r\n<ul>\r\n<li>\r\n<h4>Single</h4>\r\n<p>91.5 x 188 x<br /> 24.5 cm</p>\r\n</li>\r\n<li>\r\n<h4>Double</h4>\r\n<p>137 x 188 x<br /> 24.5 cm</p>\r\n</li>\r\n<li>\r\n<h4>Queen</h4>\r\n<p>153 x 203 x<br /> 24.5 cm</p>\r\n</li>\r\n<li>\r\n<h4>King</h4>\r\n<p>183 x 203 x<br /> 24.5 cm</p>\r\n</li>\r\n</ul>\r\n</div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class="title">LAYERS<br />(From Top to Bottom)</td>\r\n<td class="details">\r\n<ul>\r\n<li>2.5cm gel infused memory foam</li>\r\n<li>5cm gel infused 80% natural latex</li>\r\n<li>2.5cm gel infused memory foam</li>\r\n<li>14.5cm high density support foam</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class="title">COUNTRY OF<br /> ORIGIN</td>\r\n<td class="details">\r\n<p>Hugo is made in Australia with local and imported components. We source from Australian suppliers as much as possible, however some components like our natural foam latex are not made in Australia.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class="title">RECOMMENDED<br />BED BASE</td>\r\n<td class="details">\r\n<p>Hugo thrives on a firm flat surface. Bed slats, an ensemble base, your best mate’s living room floor, all good options. Bowed slats are not recommended as they can cause Hugo some damage over time.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class="title">SHIPPING</td>\r\n<td class="details">\r\n<p>Free shipping and free returns Australia wide.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class="title">WARRANTY</td>\r\n<td class="details">\r\n<p>10-year limited warranty.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class="title">TRIAL PERIOD</td>\r\n<td class="details">\r\n<p>3 month trial period and free returns.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class="accordion-title"><a href="javascript:void(0)"><span class="show">Show the details...</span><span class="hide">...Hide the details</span></a></div>\r\n</div>\r\n</div>', '2016-05-15 06:02:56', '2016-05-21 05:16:49', 1),
(22, 'Support Main Banner', 'support-main-banner', '<div class="container">\r\n<div class="banner-text-sec">\r\n<h2>Hello!</h2>\r\n<p>1300 951 185<br> <a href="mailto:hello@hugosleep.com.au">hello@hugosleep.com.au</a></p>\r\n</div>\r\n</div>\r\n<div class="scroll-arrow"><a href="#"><img src="{{view url="images/scroll-arrow.png"}}" alt="" /></a></div>', '2016-05-15 13:01:24', '2016-05-15 13:01:24', 1),
(23, 'Mobile Menu', 'mobile-menu', '<div class="mobile-nav"><a class="toggle-icon" href="javascript:void(0)">Menu</a></div>\r\n<script type="text/javascript">// <![CDATA[\r\njQuery(document).ready(function(){\r\n        jQuery(''.toggle-icon'').click(function(){\r\n            jQuery(''.mobile-menu-new'').slideToggle(600,''linear'');\r\n            jQuery(''.toggle-icon'').toggleClass(''close-icon'');\r\n        }); \r\n    });\r\n// ]]></script>', '2016-05-16 07:24:04', '2016-05-23 09:32:48', 1),
(24, 'Shop Main Banner', 'shop-main-banner', '<div class="container">\r\n<div class="banner-text-sec">\r\n<h2>Shop Hugo</h2>\r\n<p>3 month trial &amp; free shipping Australia wide!</p>\r\n</div>\r\n<div class="scroll-arrow"><a href="#"><img src="{{view url="images/scroll-arrow.png"}}" alt="" /></a></div>\r\n</div>\r\n<script type="text/javascript">// <![CDATA[\r\njQuery(document).ready(function(){\r\n	// ''catTopPosition'' is the amount of pixels #cat\r\n	// is from the top of the document\r\n	var catTopPosition = jQuery(''.product'').offset().top;\r\n	// When #scroll is clicked\r\n	jQuery(''.scroll-arrow a img'').click(function(){\r\n		// Scroll down to ''catTopPosition''\r\n		jQuery(''html, body'').animate({scrollTop:catTopPosition}, ''slow'');\r\n		// Stop the link from acting like a normal anchor link\r\n		return false;\r\n	});\r\n});\r\n// ]]></script>', '2016-05-16 10:36:30', '2016-05-20 15:47:47', 1),
(25, 'Shop Hugo Special', 'shop-hugo-special', '<div class="shop-slide-sec">\r\n<div class="container">\r\n<div class="slider-block">\r\n<ul class="shop-slider">\r\n<li><img src="{{media url="wysiwyg/banner_1.jpg"}}" alt="" /></li>\r\n<li><img src="{{media url="wysiwyg/banner_2.jpg"}}" alt="" /></li>\r\n<li><img src="{{media url="wysiwyg/banner_3.jpg"}}" alt="" /></li>\r\n<li><img src="{{media url="wysiwyg/banner_4.jpg"}}" alt="" /></li>\r\n<li><img src="{{media url="wysiwyg/banner_5.jpg"}}" alt="" /></li>\r\n</ul>\r\n</div>\r\n<script type="text/javascript">// <![CDATA[\r\n	jQuery(document).ready(function(){\r\n\r\n\r\n		  jQuery(''.shop-slider'').bxSlider({\r\n			  pager: true,\r\n			  controls: false,  \r\n		  });\r\n	});\r\n// ]]></script>\r\n</div>\r\n</div>\r\n<div class="hugo-special-sec">\r\n<div class="container">\r\n<h2>What makes Hugo special?</h2>\r\n<p>He''s a unique snowflake. But also all this stuff...</p>\r\n<a class="see-btn" href="#">See the mattress</a></div>\r\n</div>', '2016-05-17 13:06:22', '2016-05-23 13:25:16', 1),
(26, 'Test 123', 'test-123', '<p>test</p>\r\n<div class="swatch-attribute test"><span class="swatch-attribute-selected-option"></span></div>', '2016-05-17 14:01:38', '2016-05-17 14:23:17', 1),
(27, 'Shop Top Title', 'shop-top-title', '<div class="shop-top-title">\r\n<div class="container">\r\n<h2>Evening delivery available for Melbourne &amp; Sydney</h2>\r\n</div>\r\n</div>', '2016-05-17 14:11:36', '2016-05-17 14:16:24', 1),
(28, 'Checkout footer payment', 'checkout-footer-payment', '<div class="checkout-footer">\r\n	<div class="container">\r\n    	<h4>Hugo Accepts</h4>\r\n        <div class="payment-logo"><img src="{{media url="wysiwyg/payment-logos.png"}}" alt="" /></div>\r\n        <p>Copyright © 2016 Hugo. All Rights Reserved.</p>\r\n    </div>\r\n</div>', '2016-05-19 06:09:16', '2016-05-19 06:36:19', 1),
(29, 'Header Checkout', 'header-checkout', '<div class="logo"><a href="{{store url=""}}"><img src="{{media url="wysiwyg/logo-blk.png"}}" alt="" /></a></div>\r\n<h2 class="checkout-title">Checkout</h2>', '2016-05-19 06:24:24', '2016-05-20 07:36:22', 1),
(30, 'Mobile Menu Popup', 'mobile-menu-popup', '<div id="mob-menu">\r\n<ul>\r\n<li><a href="{{store url="mattress"}}">Mattress</a></li>\r\n<li><a href="{{store url="about"}}">About</a></li>\r\n<li><a href="{{store url="support"}}">Support</a></li>\r\n<li><a href="{{store url="because-size-matters.html"}}">Shop</a></li>\r\n</ul>\r\n</div>', '2016-05-20 15:11:38', '2016-05-21 13:47:30', 1),
(31, 'Terms hugo trial', 'terms-hugo-trial', '<div class="hugo-trial">\r\n<h2 class="teams-title">Hugo 3 Month Trial Period</h2>\r\n<div class="container">\r\n<p>We offer the <span>Hugo Sleep 3 month trial period</span> because we believe the majority of customers will be very happy with our product. We are willing to offer customer piece of mind through a money back return period if the customer isn''t satisfied. This is a goodwill gesture by Hugo Sleep and the following conditions do apply;</span></p>\r\n<table style="width: 100%;" border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td>1.</td>\r\n<td>The customer must have paid the purchase price for the product.</td>\r\n</tr>\r\n<tr>\r\n<td>2.</td>\r\n<td>The customer provides proof of purchase.</td>\r\n</tr>\r\n<tr>\r\n<td>3.</td>\r\n<td>The 3 month trial begins from the date of delivery.</td>\r\n</tr>\r\n<tr>\r\n<td>4.</td>\r\n<td>The refund will be for the amount paid.</td>\r\n</tr>\r\n<tr>\r\n<td>5.</td>\r\n<td>The customer must be available at the agreed pickup time.</td>\r\n</tr>\r\n<tr>\r\n<td>6.</td>\r\n<td>The refund is offered after the product has been collected</td>\r\n</tr>\r\n<tr>\r\n<td>7.</td>\r\n<td>The customer is requested to trial the product for 1 month prior to exercising their return (any change in sleep surface will require a period of adjustment).</td>\r\n</tr>\r\n<tr>\r\n<td>8.</td>\r\n<td>Trial period is limited to four (4) mattresses per customer and commercial customers are excluded.</td>\r\n</tr>\r\n<tr>\r\n<td>9.</td>\r\n<td>3 month trial period is three (3) calendar months from the date of delivery. Flexibility can be offered upon request to Hugo Sleep.</td>\r\n</tr>\r\n<tr>\r\n<td>10.</td>\r\n<td>It is expected that the product has received only fair wear and tear. Return cannot be exercised when the product has received unreasonable damage.</td>\r\n</tr>\r\n<tr>\r\n<td>11.</td>\r\n<td>Hugo Sleep will attempt to collect the product intended for return, this may be in the form of a mattress recycler or local charity, however we do reserve the right to offer a refund only and leave disposal of the mattress to the customer. This is intended for the circumstance that disposal is proving challenging due to the customers remote location, or other limiting factors.</td>\r\n</tr>\r\n<tr>\r\n<td>12.</td>\r\n<td>Hugo Sleep reserves the right to decline a refund in the circumstance we believe there is malicious intent (i.e. competitor foul play).</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '2016-05-21 15:14:20', '2016-05-23 05:46:35', 1);
