(32, 'Terms terms conditions', 'terms-terms-conditions', '<div class="terms-conditions">\r\n                    <h2 class="teams-title">Terms and Conditions</h2>\r\n                    <div class="container">\r\n                        <div class="terms-top">\r\n                        	<p>These terms and conditions regulate the business relationship between you and us. By using Our Website in any way, or by buying from us, you agree to be bound by them.</p>\r\n                            <p>No person under the age of 18 years may purchase Goods. We look forward to seeing you again when you are over 18.</p>\r\n							<p>We are: Hugo Sleep Pty Ltd Our website address is: www.hugosleep.com.au</p>\r\n                            <p>You are: a visitor to Our Website / our customer</p>\r\n                        </div>\r\n                        <h3>The terms and conditions:</h3>\r\n                        <h4>1. Defiitions</h4>\r\n                        <p class="gray">In this agreement:</p>\r\n                        <table class="name-table" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>"Carrier"</td>\r\n                            <td>means any person or business contracted by us to carry Goods from us to you</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>"Consumer"</td>\r\n                            <td>means any individual who, in connection with this agreement, is acting for a purpose which is outside his business.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>"Content" </td>\r\n                            <td>means any content in any form published on Our Website by us or any third party with our consent.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>"Goods" </td>\r\n                            <td>means any of the goods we offer for sale on Our Website, or, if the context requires, goods we sell to you.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>"Our Website" </td>\r\n                            <td>means any website of ours, and includes all web pages controlled by us.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>"Post"</td>\r\n                            <td>means display, exhibit, publish, distribute, transmit and/or disclose information, Content and/or other material on to Our Website, and the phrases "Posted" and "Posting" shall be interpreted accordingly.</td>\r\n                          </tr>\r\n                        </table>\r\n                        <h4>2. Interpretation</h4>\r\n                        <p class="gray">In this agreement unless the context otherwise requires:</p>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>2.1.</td>\r\n                            <td>a reference to a person is a reference to one or more individuals, whether or not formally in partnership, or to a corporation, government body, or other association or organization.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>2.2.</td>\r\n                            <td>these terms and conditions apply to all supplies of Goods by us to any customer. They prevail over any terms proposed by you.</td>\r\n                          </tr>\r\n                            <tr>\r\n                            <td>2.3.</td>\r\n                            <td>any agreement by any party not to do or omit to do something includes an obligation not to allow some other person to do or omit to do that same thing.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>2.4.</td>\r\n                            <td>unless otherwise stated, any obligation of any person arising from this agreement may be performed by any other person.\r\n</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>2.5.</td>\r\n                            <td>in this agreement references to a party include references to a person to whom those</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>2.6.</td>\r\n                            <td>the headings to the paragraphs and schedules (if any) to this agreement do not affect rights and obligations are transferred or passed as a result of a merger, division, rights and obligations are transferred or passed as a result of a merger, division, reconstruction or other re-organization involving that party. the interpretation.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>2.7.</td>\r\n                            <td>a reference to an act or regulation includes new law of substantially the same intent as that act or regulation.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>2.8.</td>\r\n                            <td>in any indemnity, a reference to costs or expenses shall be construed as including the estimated cost of management time of the indemnified party.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>2.9.</td>\r\n                            <td>these terms and conditions apply in any event to you as a buyer or prospective buyer of our Goods and so far as the context allows, to you as a visitor to Our Website.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>2.10.</td>\r\n                            <td>this agreement is made only in the English language. If there is any conflict in meaning between the English language version of this agreement and any version or translation of this agreement in any other language, the English language version shall prevail.</td>\r\n                          </tr>\r\n                        </table>\r\n                        <h4>3. Our Contract with you</h4>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>3.1. </td>\r\n                            <td>This agreement contains the entire agreement between the parties and supersedes all previous agreements and understandings between the parties.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>3.2.</td>\r\n                            <td>Each party acknowledges that, in entering into this agreement, he does not rely on any representation, warranty, information or document or other term not forming part of this agreement.</td>\r\n                          </tr>\r\n                            <tr>\r\n                            <td>3.3.</td>\r\n                            <td>If you use Our Website in any way and make an order on behalf of another person you warrant that you have full authority to do so and you accept personal responsibility for every act or omission by you.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>3.4.</td>\r\n                            <td>Because we rely on our suppliers, we do not guarantee that Goods advertised on Our Website are available. We may change these terms from time to time. The terms that apply to you are those posted here on Our Website on the day you order Goods.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>3.5.</td>\r\n                            <td>The price of Goods may be changed by us at any time. We will never change a price so as to affect the price charged to you at the time when you buy those Goods.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>3.6.</td>\r\n                            <td>If in future, you buy Goods from us under any arrangement which does not involve your payment via Our Website; these terms still apply so far as they can be applied.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>3.7.</td>\r\n                            <td>We do not sell the Goods in all countries. We may refuse to deliver the Goods if you live in a location we do not serve.</td>\r\n                          </tr>\r\n                       </table>\r\n                        <h4>4. Acceptance of your order</h4>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>4.1.</td>\r\n                            <td>Your order is an offer to buy from us. Nothing that we do or say will amount to any acceptance of that offer until we actually dispatch the Goods to you. At any point up until then, we may decline to supply the Goods to you without giving any reason.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>AND.</td>\r\n                            <td>&nbsp;</td>\r\n                          </tr>\r\n                            <tr>\r\n                            <td>4.2.</td>\r\n                            <td>At any time before the Goods are dispatched, we may decline to supply the Goods to you without giving any reason.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>4.3</td>\r\n                            <td>\r\n                            	If we do not have all of the Goods you order in stock, we will offer you alternatives. If this happens you may:\r\n                                <table width="100%" class="inner-table" border="0" cellspacing="0" cellpadding="0">\r\n                                  <tr>\r\n                                    <td>4.3.1</td>\r\n                                    <td>accept the alternatives we offer;</td>\r\n                                  </tr>\r\n                                  <tr>\r\n                                    <td>4.3.2</td>\r\n                                    <td>cancel all or part of your order.</td>\r\n                                  </tr>\r\n                                </table>\r\n\r\n                            </td>\r\n                          </tr>\r\n                       </table>\r\n                        <h4>5. Price & Payment</h4>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>5.1.</td>\r\n                            <td>The price payable for the Goods that you order is clearly set out on Our Website.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>5.2. </td>\r\n                            <td>It is possible that the price may have increased from that posted on Our Website. If that happens, we will not dispatch the Goods until you have confirmed that you wish to buy at the new price.</td>\r\n                          </tr>\r\n                            <tr>\r\n                            <td>5.3.</td>\r\n                            <td>Prices include goods and services tax ("GST"). If you show by your delivery address that you reside outside the Commonwealth of Australia, we will refund to you the amount charged as GST.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>5.4.</td>\r\n                            <td>If the item you order is available in parts, you must pay us the full price of your order before we will send any part of it.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>5.4.</td>\r\n                            <td>If the item you order is available in parts, you must pay us the full price of your order before we will send any part of it.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>5.5.</td>\r\n                            <td>Bank charges by the receiving bank on payments to us will be borne by us. All other charges relating to payment in a currency other than Australian dollar will be borne by you.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>5.6.</td>\r\n                            <td>Any information given by us in relation to exchange rates are approximate only and may vary from time to time.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>5.7.</td>\r\n                            <td>If, by mistake, we have under-priced Goods, we will not be liable to supply that those Goods to you at the stated price, provided that we notify you before we dispatch it to you.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>5.8.</td>\r\n                            <td>The price of the Goods does not include the delivery charge which will be charged at the rates applicable at the date you place your order and which will be displayed on a page of Our Website before we ask you to pay.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>5.9.</td>\r\n                            <td>If we owe you money (for this or any other reason), we will credit your credit or debit card as soon as reasonably practicable but in any event no later than <span>30 days</span> from the date when we accept that repayment is due.</td>\r\n                          </tr>\r\n                       </table>\r\n                        <h4>6. Security of your credit card</h4>\r\n                        <p class="gray">We take care to make Our Website safe for you to use.</p>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>6.1.</td>\r\n                            <td>Card payments are not processed through pages controlled by us. We use one or more online payment service providers who will encrypt your card or bank account details in a secure environment.</td>\r\n                          </tr>\r\n                          <tr>\r\n                          	<td>&nbsp;</td>\r\n                            <td>&nbsp;</td>\r\n                          </tr>\r\n                          <tr>\r\n                       </table>\r\n                       <h4>7. Price & Payment</h4>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>7.1.</td>\r\n                            <td>Goods are delivered within 30 days from the day you place an order to purchase the Goods.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>7.2. </td>\r\n                            <td>Deliveries will be made by the Carrier to the address stipulated in your order. You must ensure that someone is present to accept the delivery.</td>\r\n                          </tr>\r\n                            <tr>\r\n                            <td>7.3.</td>\r\n                            <td>If we are not able to deliver your Goods within 30 days of the date of your order, we shall notify you by e-mail to arrange another date for delivery.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>7.4.</td>\r\n                            <td>We may deliver the Goods in installments if they are not all available at the same time for delivery.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>7.5.</td>\r\n                            <td>Goods are sent at our risk until delivered to your specified address, at which point security of the goods becomes the responsibility of the customer.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>7.6.</td>\r\n                            <td>All Goods must be signed for on delivery by an adult aged 18 years or over. If no one of that age is at the address when the delivery is attempted the Goods may be retained by the driver, or left in a location deemed to be secure by the driver. When your Goods arrive, it is important that you check immediately the condition and quantity. If your Goods have been damaged in transit, you must refuse the delivery and immediately contact us so that we may dispatch a replacement quickly and minimize your inconvenience.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>7.7.</td>\r\n                            <td>Signing "Unchecked", "Not Checked" or similar is not acceptable.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>7.8.</td>\r\n                            <td>If we agree with you to deliver on a particular day or at a particular time, we will do our best to comply. But no time given is to be treated as contractual. So we are not liable to you for any expense or inconvenience you incur on account of delayed delivery or non-delivery.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>7.9. </td>\r\n                            <td>Some Goods are so large and heavy that delivery times may be slightly longer. In this case, approximate delivery dates will be given.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>7.10.</td>\r\n                            <td>Time for delivery specified on the order, if any, is an estimate only and time shall not be of the essence.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>7.11.</td>\r\n                            <td>We are happy for you to pick up Goods from our warehouse provided you make an appointment in advance and payment has been received.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>7.12.</td>\r\n                            <td>\r\n                                If you pick up Goods from our premises then:\r\n                                <table width="100%" class="inner-table" border="0" cellspacing="0" cellpadding="0">\r\n                                  <tr>\r\n                                    <td>7.12.1</td>\r\n                                    <td>will not be able to assist you in loading heavy items;</td>\r\n                                  </tr>\r\n                                  <tr>\r\n                                    <td>7.12.2</td>\r\n                                    <td>Goods are at your risk from the moment they are picked up by you or your Carrier from our warehouse;</td>\r\n                                  </tr>\r\n                                   <tr>\r\n                                    <td>7.12.3 </td>\r\n                                    <td>you agree that you are responsible for everything that happen after you take possession of the Goods, both on and off our premises, including damage to property of any sort, belonging to any person</td>\r\n                                  </tr>\r\n                                </table>\r\n                            </td>\r\n                          </tr>\r\n                       </table>\r\n                        <h4>8. Foreign taxes and duties</h4>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>8.1.</td>\r\n                            <td>If you are not in the Commonwealth of Australia, we have no knowledge of,and no responsibility for, the laws in your country.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>8.2.</td>\r\n                            <td>You are responsible for purchasing Goods which you are lawfully able to import and for the payment of import duties and taxes of any kind levied in your country.9. Liability for subsequent defects.</td>\r\n                          </tr>\r\n                       </table>\r\n                        <h4>9. Liability for subsequent defects</h4>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>9.1.</td>\r\n                            <td>\r\n                               We will repair or replace Goods which fail to comply with the provisions of the Competition and Consumer Act 2010or which show a defect. If you claim that the item is defective, the following conditions apply:\r\n                               <table width="100%" class="inner-table" border="0" cellspacing="0" cellpadding="0">\r\n                                  <tr>\r\n                                    <td>9.1.1 </td>\r\n                                    <td>the defect must be reported to us within four weeks of becoming apparent;</td>\r\n                                  </tr>\r\n                                  <tr>\r\n                                    <td>9.1.2</td>\r\n                                    <td>the defect results only from faulty design or manufacture;</td>\r\n                                  </tr>\r\n                                   <tr>\r\n                                    <td>9.1.3</td>\r\n                                    <td>you have returned the defective Goods or parts to us if we have so requested.</td>\r\n                                  </tr>\r\n                                </table>\r\n                            </td>\r\n                          </tr>\r\n                          <tr>\r\n                                   <td>9.2</td>\r\n                                   <td>If we agree that we are liable, we will refund the cost of return carriage and will repair or replace the Goods free of charge.</td>\r\n                          </tr>\r\n                          <tr>\r\n                                    <td>9.3.</td>\r\n                                    <td>If we repair or replace the Goods, you have no additional claim against us either under this agreement or by statute or common law, in respect of the defect.</td>\r\n                         </tr>\r\n                       </table>\r\n                        <h4>10. Disclaimers</h4>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>10.1.</td>\r\n                            <td>The law differs from one country to another. This paragraph applies so far as the applicable law allows.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>10.2.</td>\r\n                            <td>All the conditions, warranties or other terms implied by the law of any county other than the Commonwealth of Australia are excluded from this agreement to the extent permitted by law.</td>\r\n                          </tr>\r\n                          <td>10.3.</td>\r\n                            <td>We or our Content suppliers may make improvements or changes to Our Website, the Content, or to any of the Goods, at any time and without advance notice.</td>\r\n                          </tr>\r\n                          <td>10.4.</td>\r\n                            <td>You are advised that Content may include technical inaccuracies or typographical errors. This is inevitable in any large website. We would be grateful if you bring to our immediate attention, any that you find.</td>\r\n                          </tr>\r\n                          <td>10.5.</td>\r\n                            <td>\r\n                                We give no warranty and make no representation, express or implied, as to:\r\n                                <table width="100%" class="inner-table" border="0" cellspacing="0" cellpadding="0">\r\n                                  <tr>\r\n                                    <td>10.5.1.</td>\r\n                                    <td>the quality of the Goods</td>\r\n                                  </tr>\r\n                                  <tr>\r\n                                    <td>10.5.2</td>\r\n                                    <td>any implied warranty or condition as to merchantability or fitness of the Goods for a particular purpose;</td>\r\n                                  </tr>\r\n                                   <tr>\r\n                                    <td>10.5.3.</td>\r\n                                    <td>the correspondence of the Goods with any description;</td>\r\n                                  </tr>\r\n                                   <tr>\r\n                                    <td> 10.5.4.</td>\r\n                                    <td>the adequacy or appropriateness of the Goods for your purpose;</td>\r\n                                  </tr>\r\n                                   <tr>\r\n                                    <td>10.5.5.</td>\r\n                                    <td>the truth of any Content on Our Website;</td>\r\n                                  </tr>\r\n                                   <tr>\r\n                                    <td>10.5.6.</td>\r\n                                    <td>non-infringement of any right.</td>\r\n                                  </tr>\r\n                                </table>\r\n                            </td>\r\n                          </tr>\r\n                          <tr>\r\n                                <td>10.6.</td>\r\n                                <td>We are not liable in any circumstances for special, indirect or consequential loss or any damages whatsoever resulting from loss of use, loss of data or loss of revenues or profits, whether in an action of contract, negligence or otherwise, arising out of or in connection with your use of Our Website or the purchase of Goods.</td>\r\n                          </tr>\r\n                           <tr>\r\n                                <td>10.7.</td>\r\n                                <td>. Except in the case of liability for personal injury or death, our liability under this contract is limited, to the maximum extent permitted by law, to the value of the Goods you have purchased.</td>\r\n                          </tr>\r\n                       </table>\r\n                       <h4>11. Restrictions on what you may Post to Our Website</h4>\r\n                        <p class="gray">You agree that you will not use or allow anyone else to use Our Website to Post Content which is or may:</p>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>11.1.</td>\r\n                            <td>be malicious or defamatory;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>11.2.</td>\r\n                            <td>consist in commercial audio, video or music files;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>11.3.</td>\r\n                            <td>be illegal, obscene, offensive, threatening or violent;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>11.4.</td>\r\n                            <td>be sexually explicit or pornographic;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>11.5.</td>\r\n                            <td>be likely to deceive any person or be used to impersonate any person, or to misrepresent your identity, age or affiliation with any person;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>11.6.</td>\r\n                            <td>give the impression that it emanates from us or that you are connected with us or that we have endorsed you or your business;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>11.7.</td>\r\n                            <td>solicit passwords or personal information from anyone;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>11.8.</td>\r\n                            <td>be used to sell any goods or services or for any other commercial use;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>11.9.</td>\r\n                            <td>include anything other than words (i.e. you will not include any symbols or photographs) except for a photograph of yourself in your profile in such place as we designate;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>11.10.</td>\r\n                            <td> link to any of the material specified above, in this paragraph;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>11.11.</td>\r\n                            <td> send age-inappropriate communications or Content to anyone under the age of 18.</td>\r\n                          </tr>\r\n                       </table>\r\n                        <h4>12. Your Posting: restricted content</h4>\r\n                          <p class="gray">In connection with the restrictions set out below, we may refuse or edit or remove a Posting which does not comply with these terms.</p>\r\n                          <p class="gray">In addition to the restrictions set out above, a Posting must not contain:</p>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>12.1.</td>\r\n                            <td>hyperlinks, other than those specifically authorized by us;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>12.2.</td>\r\n                            <td> keywords or words repeated, which are irrelevant to the Content Posted;</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>12.3.</td>\r\n                            <td> the name, logo or trademark of any organization other than yours;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>12.4.</td>\r\n                            <td> inaccurate, false, or misleading information.</td>\r\n                          </tr>\r\n                       </table>\r\n                       <h4>13. How we handle your Content</h4>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>13.1.</td>\r\n                            <td> Our privacy policy is strong and precise. It complies fully with current law.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>13.2.</td>\r\n                            <td> If you Post Content to any public area of Our Website it becomes available in the public domain. We have no control who sees it or what anyone does with it.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>13.3.</td>\r\n                            <td> Even if access to your text is behind a user registration it remains effectively in the public domain because someone has only to register and log in, to access it. You should therefore avoid Posting unnecessary confidential information.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>13.4.</td>\r\n                            <td> We need the freedom to be able to publicize our Services and your own use of them. You therefore now irrevocably grant us the right and license to edit, copy, publish, distribute, translate and otherwise use any Content that you place on Our Website, in public domains and in any medium. You represent and warrant that you are authorized to grant all such rights.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>13.5.</td>\r\n                            <td> We will use that license only for commercial purposes of the business of Our Website and will stop using it after a commercially reasonable period of time.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>13.6.</td>\r\n                            <td> You agree to waive of your right to be identified as the author and your right to object to derogatory treatment of your work as provided in the Copyright Act 1968.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>13.7.</td>\r\n                            <td> Posting content of any sort does not change your ownership of the copyright in it. We have no claim over it and we will not protect your rights for you.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>13.8.</td>\r\n                            <td> You understand that you are personally responsible for your breach of someone else�s intellectual property rights, defamation, or any law, which may occur as a result of any Content having been Posted by you.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>13.9.</td>\r\n                            <td> You accept all risk and responsibility for determining whether any Content is in the public domain and not confidential.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>13.10.</td>\r\n                            <td> Please notify us of any security breach or unauthorized use of your account.</td>\r\n                          </tr>\r\n                       </table>\r\n                        <h4>14. Removal of offensive Content</h4>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>14.1.</td>\r\n                            <td> For the avoidance of doubt, this paragraph is addressed to any person who comes on Our Website for any purpose.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>14.2.</td>\r\n                            <td>We are under no obligation to monitor or record the activity of any customer for any purpose, nor do we assume any responsibility to monitor or police Internet-related activities. However, we may do so without notice to you and without giving you a reason.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>14.3.</td>\r\n                            <td>\r\n                                If you are offended by any Content, the following procedure applies:\r\n                                <table width="100%" class="inner-table" border="0" cellspacing="0" cellpadding="0">\r\n                                  <tr>\r\n                                    <td>14.3.1</td>\r\n                                    <td> Your claim or complaint must be submitted to us in the form available on Our Website, or contain the same information as that requested in our form. It must be sent to us by post or email.</td>\r\n                                  </tr>\r\n                                  <tr>\r\n                                    <td>14.3.2</td>\r\n                                    <td> we shall remove the offending Content as soon as we are reasonably able;</td>\r\n                                  </tr>\r\n                                   <tr>\r\n                                    <td>14.3.3</td>\r\n                                    <td> after we receive notice of a claim or complaint, we shall investigate so far as we alone decide;</td>\r\n                                  </tr>\r\n                                </table>    \r\n                            </td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>14.4.</td>\r\n                            <td>We may re-instate the Content about which you have complained or not.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td> 14.5.</td>\r\n                            <td> In respect of any complaint made by you or any person on your behalf, whether using our form of complaint or not, you now irrevocably grant to us a licence to publish the complaint and all ensuing correspondence and communication, without limit.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>14.6.</td>\r\n                            <td>You now agree that if any complaint is made by you frivolously or vexatious you will repay us the cost of our investigation including legal fees, if any.</td>\r\n                          </tr>\r\n                       </table>\r\n                       <h4>15. Security of Our Website</h4>\r\n                       <p class="gray">If you violate Our Website we shall take legal action against you.</p>\r\n                       <p class="gray">You now agree that you will not, and will not allow any other person to:</p>\r\n                       <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>15.1.</td>\r\n                            <td>modify, copy, or cause damage or unintended effect to any portion of Our Website, or any software used within it.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>15.2.</td>\r\n                            <td>link to Our Website in any way that would cause the appearance or presentation of the site to be different from what would be seen by a user who accessed the site by typing the URL into a standard browser; </td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>15.3.</td>\r\n                            <td>download any part of Our Website, without our express written consent;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>15.4.</td>\r\n                            <td>collect or use any product listings, descriptions, or prices;</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>15.5.</td>\r\n                            <td>collect or use any information obtained from or about Our Website or the Content except as intended by this agreement;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>15.6.</td>\r\n                            <td>aggregate, copy or duplicate in any manner any of the Content or information available from Our Website, other than as permitted by this agreement or as is reasonably necessary for your use of Our Website;</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>15.7.</td>\r\n                            <td>share with a third party any login credentials to Our Website.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>15.8.</td>\r\n                            <td>\r\n                            	Despite the above terms, we now grant a license to you to:\r\n                                <table class="inner-table" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                                    <tr>\r\n                                        <td>15.8.1 </td>\r\n                                        <td>create a hyperlink to Our Website for the purpose of promoting an interest common to both of us. You can do this without specific permission. This license is conditional upon your not portraying us or any product or service in a false, misleading, derogatory, or otherwise offensive manner. You may not use any logo or other proprietary graphic or trademark of ours as part of the link without      our express written consent.</td>\r\n                                    </tr>\r\n                                     <tr>\r\n                                        <td>15.8.2 </td>\r\n                                        <td>after we receive notice of a claim or complaint, we shall investigate so far as we alone decide;</td>\r\n                                    </tr>\r\n                                </table>\r\n                            </td>\r\n                          </tr>\r\n                          \r\n                       </table>\r\n                       <h4>16. Indemnity</h4>\r\n                       <p class="gray">You agree to indemnify us against all costs, claims and expense arising directly or indirectly from:</p>\r\n                       <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>16.1. </td>\r\n                            <td>your failure to comply with the law of any country;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>16.2.</td>\r\n                            <td>your breach of this agreement;</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>16.3. </td>\r\n                            <td>any act, neglect or default by any agent, employee, licensee or customer of yours;</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>16.4.</td>\r\n                            <td>a contractual claim arising from your use of the Goods;</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>16.5.</td>\r\n                            <td>a breach of the intellectual property rights of any person.</td>\r\n                          </tr>\r\n                       </table>\r\n                        <h4>17. Intellectual Property</h4>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>17.1.</td>\r\n                            <td>We will defend the intellectual property rights in connection with our Goods and Our Website, including copyright in the Content whether provided by us or by any other content provider (including copyright in text, graphics, logos, icons, images, audio clips, digital downloads, data, and software).</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>17.2.</td>\r\n                            <td>Except as set out below, you may not copy, modify, publish, transmit, transfer or sell, reproduce, create derivative works from, distribute, perform, display, or in any way exploit any of the Content, in whole or in part.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>17.3.</td>\r\n                            <td>You may not use our name or logos or trademarks or any other Content on any website of yours or that of any other person.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>17.4.</td>\r\n                            <td>Subject to the other terms of this agreement, you may download or copy Content only for your own personal use, provided that you maintain all copyright and other notices contained in it. You may not store electronically any significant portion of any Content.</td>\r\n                          </tr>\r\n                       </table>\r\n                       <h4>18. Miscellaneous matters</h4>\r\n                       <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                          <tr>\r\n                            <td>18.1.</td>\r\n                            <td>When we communicate with you we do so by email. You agree that email communications are contractually binding in the same way as properly signed and dated paper sent by post.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>18.2.</td>\r\n                            <td>Where we provide goods without specific charge to you, then it (or they) is deemed to be provided free of charge, and not to be associated with any other Goods for which a charge is made. Accordingly, there is neither contractual nor other obligation upon us in respect of those goods or that service.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>18.3.</td>\r\n                            <td>If any term or provision of this agreement is at any time held by any jurisdiction to be void, invalid or unenforceable, then it shall be treated as changed or reduced, only to the extent minimally necessary to bring it within the laws of that jurisdiction and to prevent it from being void and it shall be binding in that changed or reduced form. Subject to that, each provision shall be interpreted as severable and shall not in any way affect any other of these terms.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>18.4.</td>\r\n                            <td>The rights and obligations of the parties set out in this agreement shall pass to any permitted successor in title.</td>\r\n                          </tr>\r\n                           <tr>\r\n                            <td>18.5.</td>\r\n                            <td>No failure or delay by any party to exercise any right, power or remedy will operate as a waiver of it nor indicate any intention to reduce that or any other right in the future.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>18.4.</td>\r\n                            <td>The rights and obligations of the parties set out in this agreement shall pass to any permitted successor in title.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>18.4.</td>\r\n                            <td>The rights and obligations of the parties set out in this agreement shall pass to any permitted successor in title.</td>\r\n                          </tr>\r\n                          <tr>\r\n                          	<td>&nbsp;</td>\r\n                            <td>\r\n                            	<p class="gray">It shall be deemed to have been delivered:</p>\r\n                                <ul>\r\n                                	<li>if delivered by hand: on the day of delivery;</li>\r\n                                    <li>if sent by post to the correct address: within 72 hours of posting;</li>\r\n                                    <li>If sent by e-mail to the address from which the receiving party has last sent e-mail: within 24 hours if no notice of non-receipt has been received by the sender.</li>\r\n                                </ul>\r\n                            </td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>18.7.</td>\r\n                            <td>In the event of a dispute between the parties to this agreement, then they undertake to attempt to settle the dispute by engaging in good faith with the other in a process of mediation before commencing arbitration or litigation.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>18.8.</td>\r\n                            <td>This agreement does not give any right to any third party.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>18.9.</td>\r\n                            <td>Neither party shall be liable for any failure or delay in performance of this agreement which is caused by circumstances beyond his reasonable control.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>18.10.</td>\r\n                            <td>In the event of any conflict between any term of this agreement and the provisions of the constitution of a limited company or any comparable document intended to regulate any other corporate or collective body, then the terms of this agreement shall prevail.</td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td>18.11.</td>\r\n                            <td>The validity, construction and performance of this agreement shall be governed by the laws of the State of Victoria.</td>\r\n                          </tr>\r\n                       </table>\r\n                    </div>\r\n                </div> ', '2016-05-21 15:16:24', '2016-05-22 04:58:16', 1);
INSERT INTO `cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(33, 'Terms privacy policy', 'terms-privacy-policy', '<div class="privacy-policy">\r\n                	<h2 class="teams-title">Privacy Policy and Notice</h2>\r\n                    <div class="container">\r\n                    	<div class="privacy-top">\r\n                    	<p>This is the privacy notice of Hugo Sleep Pty Ltd. In this document, ""we", "our", or "us" refers to Hugo Sleep registered in Australia with ACN 608 350 769.</p>\r\n                        <p>This is a notice to inform you of our policy about all information that we record about you. It covers both information that could and could not identify you and information.</p>\r\n                        <p>We are extremely concerned to protect your privacy and confidentiality. We understand that all users of our web site are quite rightly concerned to know that their data will not be used for any purpose unintended by them, and will not accidentally fall into the hands of a third party. Our policy is both specific and strict. It complies with Australian law. If you think our policy falls short of your expectations or that we are failing to abide by our policy, do please tell us.</p>\r\n                        <p>We regret that if there are one or more points below with which you are not happy, your only recourse is to leave our web site immediately.</p>\r\n                        <p>Except as set out below, we do not share, or sell, or disclose to a third party, any personally identifiable information collected at this site.</p>\r\n                        <p>Here is a list of the information we collect from you, either through our web site or because you give it to us in some other way, and why it is necessary to collect it:</p>\r\n                        </div>\r\n						<h4>1. Business and personal information</h4>\r\n                        <p>This includes basic identification and contact information, such as your name and contact details and also includes all information given to us in the course of your business and ours, such as information you give us in your capacity as our client. We undertake to preserve the confidentiality of the information and of the terms of our relationship. It is not used for any other purpose. We expect you to reciprocate this policy.</p>\r\n						<p class="gray">This information is used:</p>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                            <tr>\r\n                                <td>1.1.</td>\r\n                                <td>this agreement does not give any right to any third party.</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td>1.2.</td>\r\n                                <td>for verifying your identity for security purposes;</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td>1.3.</td>\r\n                                <td>for marketing our services and products;</td>\r\n                            </tr>\r\n                             <tr>\r\n                                <td>1.4.</td>\r\n                                <td>information which does not identify any individual may be used in a general way by us or third parties, to provide class information, for example relating to demographics or usage of a particular page or service.</td>\r\n                            </tr>\r\n                            <tr>\r\n                            	<td colspan="2">We keep information, which forms part of our business record for a minimum of six years. That is because we may need it in some way to support a claim or defence in court. That is also the period within which our tax collecting authorities may demand to know it.</td>\r\n                            </tr>\r\n                           <tr>\r\n                           		<td>&nbsp;</td>\r\n                                <td>&nbsp;</td>\r\n                           </tr> \r\n                        </table>\r\n                        <h4>2. Your domain name and e-mail address</h4>\r\n                        <p class="gray">This information is recognized by our servers and the pages that you visit are recorded. We shall not under any circumstances, divulge your e-mail address to any person who is not an employee or contractor of ours and who does not need to know, either generally or specifically. This information is used:</p>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                            <tr>\r\n                                <td>2.1.</td>\r\n                                <td>to correspond with you or deal with you as you expect;</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td>2.2.</td>\r\n                                <td>in a collective way not referable to any particular individual, for the purpose of quality control and improvement of our site;</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td>2.3.</td>\r\n                                <td>to send you news about the services to which you have signed up;</td>\r\n                            </tr>\r\n                             <tr>\r\n                                <td>2.4.</td>\r\n                                <td>to tell you about other of our services or services of sister web sites.</td>\r\n                            </tr>\r\n                        </table>\r\n                        <h4>3. Information you post on our website</h4>\r\n                        <p class="gray border">This information is recognised by our servers and the pages that you visit are recorded. We shall not under any circumstances, divulge your e-mail address to any person who is not an employee or contractor of ours and who does not need to know, either generally or specifically. This information is used:</p>\r\n                        <h4>4. Website usage information</h4>\r\n                        <p class="gray border">We may use software embedded in our website to collect information about pages you view and how you have reached them, what you do when you visit a page, the length of time you remain on the page, and how we perform in providing content to you. </p>\r\n                        <h4>5. Financial information relating to your credit cards</h4>\r\n                        <p class="gray border">This information is never taken by us either through our website or otherwise. At the point of payment, you are transferred to a secure page on the website of Stripe or some other reputable payment service provider. That page may be dressed in our "livery", but it is not controlled by us. Our staff and contractors never have access to it. </p>\r\n                        <h4>6. Information we obtain from third parties</h4>\r\n                        <p class="gray border">Although we do not disclose your personal information to any third party (except as set out in this notice), we do receive data which is indirectly made up from your personal information, from software services such as Google Analytics and others. No such information is identifiable to you.</p>\r\n                        <h4>7. Your Posting: restricted content</h4>\r\n                        <p class="gray">Cookies are small text files that are placed on your computer''s hard drive through your web browser when you visit any web site. They are widely used to make web sites work, or work more efficiently, as well as to provide information to the owners of the site.</p>\r\n                        <p class="gray">Like all other users of cookies, we may request the return of information from your computer when your browser requests a web page from our server. Cookies enable our web server to identify you to us, and to track your actions and the pages you visit while you use our website. The cookies we use may last for a single visit to our site (they are deleted from your computer when you close your browser), or may remain on your computer until you delete them or until a defined period of time has passed.</p>\r\n                        <p class="gray">Although your browser software enables you to disable cookies, we recommend that you allow the use of cookies in order to take advantage of the features of our website that rely on their use. If you prevent their use, you will not be able to use all the functionality of our website. Here are the ways we use cookies:</p>\r\n                        <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                            <tr>\r\n                                <td>7.1. </td>\r\n                                <td>to record whether you have accepted the use of cookies on our web site. This is solely to comply with the law. If you have chosen not to accept cookies, we will not use cookies for your visit, but unfortunately, our site will not work well for you;</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td>7.2.</td>\r\n                                <td>to allow essential parts of our web site to operate for you;</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td>7.3.</td>\r\n                                <td>to operate our content management system;</td>\r\n                            </tr>\r\n                             <tr>\r\n                                <td>7.4.</td>\r\n                                <td>to operate the online notification form - the form that you use to contact us for any reason. This cookie is set on your arrival at our web site and deleted when you close your browser;</td>\r\n                            </tr>\r\n                            <tr>\r\n                            	<td>7.5.</td>\r\n                                <td>to enhance security on our contact form. It is set for use only through the contact form. This cookie is deleted when you close your browser;</td>\r\n                            </tr>\r\n                             <tr>\r\n                            	<td>7.6.</td>\r\n                                <td>to collect information about how visitors use our site. We use the information  to improve your experience of our site and enable us to increase sales. This cookie collects information in an anonymous form, including the number of visitors to the site, where visitors have come to the site from, and the pages they visited;</td>\r\n                            </tr>\r\n                            <tr>\r\n                            	<td>7.7. </td>\r\n                                <td>to store your personal information so that you do not have to provide it afresh when you visit the site next time.;</td>\r\n                            </tr>\r\n                            <tr>\r\n                            	<td>7.8. </td>\r\n                                <td>to enable you to watch videos we have placed on YouTube. YouTube will not store personally identifiable cookie information when you use YouTube''s privacy-enhanced mode.</td>\r\n                            </tr>\r\n                        </table>\r\n                        <h4>8. Calling our help line</h4>\r\n                        <p class="gray border">When you call our help line, we collect Calling Line Identification (CLI) information. We use this information to help improve the efficiency and effectiveness of our help line.</p>\r\n                        <h4>9. Sending a message to our support system</h4>\r\n                        <p class="gray border">When you send a message, we collect the data you have given to us in that message in order to obtain confirmation that you are entitled to receive the information and to provide to you the information you need. We record your request and our reply in order to increase the efficiency of our business / organization.</p>\r\n                         <h4>10. Complaining</h4>\r\n                        <p class="gray">When we receive a complaint, we record all the information you have given to us. We use that information to resolve your complaint. If your complaint reasonably requires us to contact some other person, we may decide to give to that other person some of the information contained in your complaint. We do this as infrequently as possible, but it is a matter for our sole discretion as to whether we do give information, and if we do, what that information is.</p>\r\n                        <p class="gray border">We may also compile statistics showing information obtained from this source to assess the level of service we provide, but not in a way that could identify you or any other person.</p>\r\n                        <h4>11. Job application and employment</h4>\r\n                        <p class="gray">If you send us information in connection with a job application, we may keep it for up to three years in case we decide to contact you at a later date.</p>\r\n                        <p class="gray border">If we employ you, we collect information about you and your work from time to time throughout the period of your employment. This information will be used only for purposes directly relevant to your employment. After your employment has ended, we will keep your file for six years before destroying or deleting it.</p>\r\n                        <h4>12. Re-marketing</h4>\r\n                         <p class="gray border">We may use re-marketing from time to time. This involves Google or some other supplier placing a tag or marker on your website in order to be able to serve to you an advert for our products / services when you visit some other website.</p>\r\n                         <h4>13. Affiliate information</h4>\r\n                         <p class="gray border">This is information given to us by you in your capacity as an affiliate of us or a customer or client of ours. Such information is retained for business use only. We undertake to preserve the confidentiality of the information and of the terms of our relationship. It is not used for any other purpose. We expect any affiliate to agree to reciprocate this policy. As an exception to this, we have the right to disclose your first name and URL of your affiliate connection to other affiliates and to any other person or organization, on and off site. The reason is solely to enable us to mention winners and others whose performance as an affiliate is in some way outstanding.</p>\r\n                         <h4>14. Use of site by children</h4>\r\n                         <p class="gray border">We do not market to children, nor do we sell products or services for purchase by children. We do sell products and services for end use by children, but for purchase by adults. If you are under 18, you may use our site only with consent from a parent orguardian.</p>\r\n                         <h4>15. Disclosure to Government and their agencies</h4>\r\n                         <p class="gray border">We are subject to the law like everyone else. We may be required to give information to legal authorities if they so request or if they have the proper authorisation such as a search warrant or court order.</p>\r\n                         <h4>16. Compliance with the law</h4>\r\n                         <p class="gray border">This confidentiality policy has been compiled so as to comply with the law of every jurisdiction in which we aim to do business. If you think it fails to satisfy the law of your country, we should like to hear from you, but ultimately it is your choice as to whether you wish to use our website.</p>\r\n                          <h4>17. Review or update personally identifiable information</h4>\r\n                         <p class="gray border">At any time you may review or update the personally identifiable information that we hold about you, by contacting us at the address below. To better safeguard your information, we will also take reasonable steps to verify your identity before granting access or making corrections to your information.</p>\r\n                          <h4>18. Data may be "processed" outside Australia</h4>\r\n                         <p class="gray border">We use outsourced services in countries outside Australia from time to time in aspects of our business. Accordingly data obtained within Australia may be "processed" outside Australia and data obtained in any other country may be processed within or outside that country.</p>\r\n                         <h4>19. Your Posting: restricted content</h4>\r\n                         <table class="number" width="100%" border="0" cellspacing="0" cellpadding="0">\r\n                            <tr>\r\n                                <td>19.1.</td>\r\n                                <td>If you have a complaint about how we are collected or handled your personal information, please contact us. We will endeavor in the first instance to deal with your complaint and take action to resolve the matter.</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td>19.2.</td>\r\n                                <td>If your complaint cannot be resolved at the first instance, we will ask you to lodge a formal complaint in writing, explaining the circumstances of the matter that you are complaining about, how you believe your privacy has been interfered with and how you believe your complaint should be resolved.</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td>19.3. </td>\r\n                                <td>We will acknowledge receipt of your formal complaint and indicate the timeframe that you can expect a response. We will endeavour to resolve the complaint as quickly as possible, but if the matter is complex and our investigation may take longer, we will let you know when we expect to provide our response.</td>\r\n                            </tr>\r\n                             <tr>\r\n                                <td>19.4.</td>\r\n                                <td>If you are unhappy with our response, you may refer your complaint to the Office of the Australian Information Commissioner</td>\r\n                            </tr>\r\n                        </table>\r\n                    </div>\r\n                </div> ', '2016-05-21 15:40:27', '2016-05-21 15:40:27', 1),
(34, 'Terms contact us', 'terms-contact-us', '<div class="contact-us">\r\n<h2 class="teams-title">How to Contact Us</h2>\r\n<div class="container">\r\n<h5>Emailing</h5>\r\n<p><a href="mailto: hello@hugosleep.com.au"> hello@hugosleep.com.au</a></p>\r\n<h5>Sending a letter to us at:</h5>\r\n<p><span>Attn:</span> Privacy Officer<br /> Hugo Sleep<br /> PO Box 146<br /> Fiztroy VIC 3065</p>\r\n<h5>OAIC contact details:</h5>\r\n<p>Officer of the Australian Information Commissioner (OAIC)<br /> <span>Email:</span> <a href="mailto:enquiries@oaic.gov.au">enquiries@oaic.gov.au</a></p>\r\n</div>\r\n</div>', '2016-05-21 15:46:56', '2016-05-23 07:58:00', 1);
