INSERT INTO `zealousweb_faq_faq` (`faq_id`, `title`, `description`, `is_active`, `creation_time`, `update_time`) VALUES
(4, 'Why does Hugo have 2 different layers of memory foam?', 'When designing Hugo we discovered it was seriously comfortable with 2 separate layers of memory foam either side of latex. Too much latex can feel quite firm, too much memory foam can feel like you''re sinking, we''ve found the sweet spot.', 1, '2016-05-15 06:13:12', '2016-05-23 05:24:51'),
(5, 'Is 3 months long enough for a trial?', 'It should take you about a month to adjust to your new mattress, if it''s taking much longer than that, give us a call!', 1, '2016-05-15 06:14:24', '2016-05-23 05:24:08'),
(6, 'Will you resell returned mattresses?', 'Nope! We handle this on a case by case basis, but typically it will either go to charity, or to a mattress recyclers. ', 1, '2016-05-15 06:14:42', '2016-05-23 05:23:36'),
(7, 'How does the trial period work?', 'If you purchase a Hugo and you''re not loving it, we will give you a full refund within the first 3 months. Don''t worry, you won''t need to fit it back inside the box.', 1, '2016-05-15 06:14:59', '2016-05-23 05:23:12'),
(8, 'How do you fit Hugo in that box?', 'Pure muscle…and a giant compression machine. Because Hugo is made from such high quality foams, it can be compressed to fit inside the box and return to it''s original shape when released.', 1, '2016-05-15 06:15:15', '2016-05-23 05:22:51'),
(9, 'Why type of glue does Hugo use to hold the foam layers together?', 'Hugo is bound together with a thin layer of water based glue between each layer of foam. We choose to use water based glue for health and environmental reasons. ', 1, '2016-05-15 06:15:41', '2016-05-23 05:21:58'),
(10, 'I’ve heard compressed mattresses can have an odour when opened?', 'Hugo is made in Australia so it doesn''t stay compressed for long. It''s ''new car smell'' is relatively mild in comparison to a product imported from overseas. If you can smell a little something once Hugo is out of the box, ventilate the room and it will pass shortly.', 1, '2016-05-15 06:16:04', '2016-05-23 05:21:38'),
(11, 'Have you considered a pillow top for Hugo?', 'A pillow top might feel great initially, but it does have it''s drawbacks. Pillow tops are less supportive, with uneven wear and heat trapping over time.', 1, '2016-05-15 06:16:29', '2016-05-23 05:21:18'),
(12, 'Can one comfort feel really be suitable for everyone?', 'We think you''ll love Hugo as much as he loves you, but if you prefer to slumber on the concrete or siesta in a bag of marshmallows, Hugo might not be for you. Our 3 month trial is the perfect way to find out!', 1, '2016-05-15 06:16:51', '2016-05-23 05:21:01'),
(13, 'Why does Hugo only come in one comfort feel?', 'Hugo was born to simplify the process of a good night sleep. That''s why we work with experts to make one amazing mattress. We know you''re going to love it.', 1, '2016-05-15 06:17:20', '2016-05-23 05:20:43'),
(14, 'What should I do with my old mattress?', 'Give us a call! We can help recommend a charity or recycling program in your area to take away your old sleeper.', 1, '2016-05-15 06:17:40', '2016-05-23 05:20:24'),
(15, 'Once removed from the box, how long will Hugo take to return to size?', 'Once he''s out of the box, Hugo bloats faster than a lactose intolerant eating cheesecake. ', 1, '2016-05-15 06:17:52', '2016-05-23 05:20:03'),
(16, 'What type of bed frame should I use?', 'Hugo thrives on a firm flat surface. Bed slats, an ensemble base, your best mate''s living room floor, all good options. Bowed slats are not recommended as they can cause Hugo some damage over time.', 1, '2016-05-15 06:18:07', '2016-05-23 05:19:39'),
(17, 'Can I have custom shipping requirements?', 'Sure thing! Call us and we can help make your shipping dreams come true, hopefully.', 1, '2016-05-15 06:18:20', '2016-05-23 05:19:20'),
(18, 'How long does shipping take?', 'It''s quick. Hugo is eager to meet you so he''ll be knocking on your door as quick as he can. In the rare situation we''re out of stock, made in Australia means we''ll be back in stock in a jiffy. We will keep you informed every step of the way.', 1, '2016-05-15 06:18:40', '2016-05-23 05:18:40'),
(19, 'Is Hugo paleo friendly?', 'Umm, sure. ', 1, '2016-05-15 06:18:57', '2016-05-23 06:57:15');
